INSERT INTO `configurations` VALUES (1,'CFG_KEY_SEMESTER','2',NULL,'2009-11-09 12:54:32','2012-11-07 17:12:00'),(2,'CFG_KEY_YEAR','2012',NULL,'2009-11-09 12:54:32','2012-11-07 17:12:00'),(3,'CFG_KEY_EMAIL',NULL,'<p>\r\nELECTRONIC PROCESSING OF RESULTS\r\n</p>\r\n<p>\r\nThe results processing system is accessed from the following website - http://agile1.ucc.usyd.edu.au/rps (or go to the Conservatorium website, click on \'staff\' and then \'results processing\'.\r\n</p>\r\n<p>\r\nExaminers will be issued a unique sign-on and password for the units they are examining.  Please find your details at the end of this e-mail.\r\n</p>\r\n<p>\r\nPlease do not leave these written down anywhere obvious or where anyone else could gain even fleeting access.  No one else is permitted to access the results for those units of study for which you are the examiner.\r\n</p>\r\n<p>\r\nThe system allows examiners to add results as they become available and to save the file progressively until all results have been added.  It is very important that the \"Finish\" button at the end is only clicked if you have entered all results for that unit of study.  If you have only partly completed the information, please just click the \"Saved\" button.\r\n</p>\r\n<p>\r\nWhen examiners have completed a mark and/or grade for every student listed on the sheet and clicked the \"Finish\" button, an e-mail containing the entire record will be generated and sent to the examiner.  At that stage, examiners must check that the results recorded are correct, print the record, sign and date it and send it in a sealed confidential envelope to Cedric Poon, Student Administration.  This should be done without delay as the results are not sent to the University until the signed hard copy is received by Cedric. Results will be published progressively on the web from Monday 26 November and the deadline for return of examination results to Student Records is Friday 14 December.\r\n</p>\r\n<p>\r\n\r\n\r\n    2.  MISSING OR ADDITIONAL STUDENTS AND RESULTS\r\n</p>\r\n<p>\r\nExaminers should issue an Absent Fail (AF) grade for any student who is enrolled and showing on the results sheet but who did not attend and for whom there is no result.\r\n</p>\r\n<p>\r\n    3.  RESULTS GRADES\r\n</p>\r\n<p>\r\nThe tables below show the valid results that may be used by examiners.\r\n</p>\r\n<p>\r\nHD, High  Distinction, 85 - 100</br>\r\nOutstanding level of achievement\r\n</p>\r\n<p>\r\nD, Distinction, 75 - 84</br>\r\nHigh level of achievement\r\n</p>\r\n<p>\r\nCR, Credit, 65 - 74</br>\r\nAbove average level of achievement\r\n</p>\r\n<p>\r\nP, Pass, 50 - 64</br>\r\nRequired  level of achievement\r\n</p>\r\n<p>\r\nR. Satisfied requirements</br>\r\nResult  used in non-graded courses with a Pass/Fail only outcome\r\n</p>\r\n<p>\r\nUCN,    Unit of  Study Continuing</br>\r\nUsed at the end of a semester for units approved to extend into a following semester.  In the past this was only used for \'Thesis\' units at the Conservatorium â€“ most students no longer enrol in thesis units of study, but there may be some students still enrolled under the old rules who are enrolled in these units.\r\n</p>\r\n<p>\r\n</p>\r\n<p>\r\nF, FAIL - 0 - 49</br>\r\nFailure to attain the required level of achievement.\r\n</p>\r\n<p>\r\nAF, Absent Fail</br>\r\nFailure due to non-attendance at examination or non-submission of compulsory work.\r\n</p>\r\n<p>\r\nDNF, Discontinued - Not to count as fail</br>\r\nDiscontinued with permission.  This result applies automatically where a student discontinues after the HECS census date but before the end of the seventh week of semester.  The Pro-Dean may determine that the result of DNF is warranted after this date if the student has made out a special case based on illness or misadventure.  Examiners should enter a grade of AF and contact the Pro-Dean if they want the mark to be recorded as DNF.\r\n</p>\r\n<p>\r\nTemporary  Results\r\n</p>\r\n<p>\r\nINC, Incomplete</br>\r\nThis temporary result is used when examiners have grounds for seeking further information or for considering additional work from the student before confirming the final result.  This is to be converted to a passing or failing grade.  If unconverted by the end of the second week of second semester, the result will default to AF.\r\n</p>\r\n<p>\r\nMINC, Incomplete with a mark of at least 50</br>\r\nThis temporary result may be used when examiners have grounds for seeking further information  or for considering additional work from the student before confirming the final mark and passing grade.  This is to be converted to a passing or failing grade.  If unconverted by the end of the second week of second semester, the result will be automatically converted to the indicated mark and grade.\r\n</p>\r\n<p>\r\nExaminers are not required to submit grades for marks of 50 or more as these will be automatically assigned.  However, grades must be assigned for all marks below 50.\r\n</p>\r\n<p>\r\nNo marks should contain decimal points.\r\n</p>\r\n<p>\r\n    3.  SECURITY AND CONFIDENTIALITY\r\n</p>\r\n<p>\r\nExaminers must ensure that they check, sign and date a hard copy of the final result sheet, and submit this to Cedric Poon of Student Administration as soon as possible after finishing the electronic version.  Examiners should print the e-mailed copy of the results as it is not possible to print direct from the website.\r\n</p>\r\n<p>\r\n\r\n</p>\r\n<p>\r\nPlease note that students\' examination worked scripts must be retained within Units for a minimum of FOUR months.  Retention beyond this period is at the discretion of the Unit.  Examiners should contact the University\'s  Freedom of Information Officer on extension 14263 if further information is required.\r\n</p>\r\n<p>\r\n    4.  SPECIAL CONSIDERATION\r\n</p>\r\n<p>\r\nStudents who have a serious illness, or who have experienced a misadventure which may affect their academic performance in a course or units of study, may request that they be given special consideration in relation to the determination of their results.  Applications for special consideration  may be made in respect of any or all factors which contribute to assessment in a unit of study, including assessment tasks, examinations, recitals and attendance requirements.\r\n</p>\r\n<p>\r\nThe detailed policy approved by the Academic Board in August 2003 is available at the following website -\r\n</p>\r\n<p>\r\nhttp://www.music.usyd.edu.au/docs/special_consideration_policy.html\r\n</p>\r\n<p>\r\n    5.  EXAMINERS\' MANUAL\r\n</p>\r\n<p>\r\nStudent Administration has a small number of copies of the University\'s manual for examiners.  If anyone would like a copy, please let us know.\r\n</p>','2009-11-09 12:54:32','2012-11-07 17:12:00'),(4,'CFG_KEY_SIGNATURE',NULL,'<p>Cedric Poon</br>\r\nManager, Student Administration</br>\r\nSydney Conservatorium of Music</br>\r\nUniversity of Sydney NSW 2006</br>\r\nph: +6 12 9351 1239</br>  \r\nFax:  +61 2 9351 1200</br>\r\nemail:cedric.poon@sydney.edu.au</br>\r\n</p>','2009-11-09 12:54:32','2012-11-07 17:12:00');
